import React, { Component } from "react";
import "../App.css";
import Card from "../components/Card.js";

class Books extends Component {
  render() {
    return (
      <div style={{width: "150rem"}}>
        <Card title="Books"/>
      </div>
    );
  }
}

export default Books;
